import React from "react";

import './Input.css';

const Input = props => {
    const inputfield = props.inputfieldtype === 'input' ? (<input/>) :(<textarea />);

    return <div className={`form-control`}>
        <label htmlFor={props.id}>{props.label}</label>
        {inputfield}
    </div>
}

export default Input;
